import React, { useEffect, useState } from 'react';
import styles from './perfil.module.css';

function Profile() {
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [createdAt, setCreatedAt] = useState('');
  const [password, setPassword] = useState('');

  useEffect(() => {
    const storedUsername = localStorage.getItem('username');
    const storedEmail = localStorage.getItem('email');
    const storedCreatedAt = localStorage.getItem('createdAt');
    const storedPassword = localStorage.getItem('password');

    if (storedUsername) setUsername(storedUsername);
    if (storedEmail) setEmail(storedEmail);
    if (storedCreatedAt) setCreatedAt(storedCreatedAt);
    if (storedPassword) setPassword(storedPassword);
  }, []);

  return (
    <div className={styles.profileContainer}>
      <h1 className={styles.profileHeader}>Profile</h1>
      <p className={styles.profileInfo}>Username: {username}</p>
      <p className={styles.profileInfo}>Email: {email}</p>
      <p className={styles.profileInfo}>Created At: {createdAt}</p>
    </div>
  );
}

export default Profile;
